function NewsSingle() {
	const { newSingle, setNewSingle } = useContext(Context);
	
	const foundSingleNew = data.find((e) => e.id == newSingle);
	console.log(foundSingleNew);
	
	let lastNew = data.slice(0, 5);
	const SelectNew = (e) => {
		const foundNewId = e.target.dataset.newId;
		setNewSingle(foundNewId);
	};
	const myLoader = ({ src, width, quality }) => {
		return `${src}?w=${width}&q=${quality || 75}`;
	};

	const {
		count: { lang },
	} = useSelector((state) => state);

	const { news } = Content[lang];
	

	return (
		<>
			<NewsHero localization={news.hero} />
			<section className="news-single__info">
				<div className="news-info__top"></div>
				<div className="container">
					<div className="single-news__box__top">
						<div className="news-single__box">
							<h2 className="news-single__heading">
								{foundSingleNew?.name}
							</h2>
							<div className="news-single__img-box">
								<Image
									loader={myLoader}
									className="news-single__img"
									src={foundSingleNew?.img}
									width={800}
									height={500}
									alt="Single news pic"
								/>
							</div>
							<div className="recent-posts__created single__create">
								<time
									datatime={foundSingleNew?.create_at}
									className="recent-posts__created__time single__time"
								>
									{foundSingleNew?.create_at}
								</time>
							</div>
							<p className="new-single__discription">
								{foundSingleNew?.discription}
							</p>
						</div>
						<div>
							<div className="news-info__recent-posts  news-info__recent-posts-single">
								<h3 className="news-info__recent-posts__heading">
									Soʻnggi xabarlar
								</h3>
								<ul className="recent-posts__list">
								{lastNew &&
										lastNew.map((e, i) => (
											<li key={i} className="recent-posts__item recent-posts__item-single">
												<Link href="/new/single">
													<a 
														onClick={SelectNew}
														data-new-id={e.id}
														className="recent-posts__link">
														<div className=" recent-posts__img-box recent-posts__img-box-single">
															<Image
																loader={myLoader}
																onClick={SelectNew}
																data-new-id={e.id}
																className="recent-posts__img"
																src={e.img}
																alt="new info"
																width={120}
																height={120}
															/>
														</div>
														<div className="recent-posts__info recent-posts__info_single">
															<div className="recent-posts__created">
																<time
																	onClick={SelectNew}
																	data-new-id={e.id}
																	datatime={e.create_at}
																	className="recent-posts__created__time"
																>
																	{e.create_at}
																</time>
															</div>
															<h2 
																onClick={SelectNew}
																data-new-id={e.id}
																className="recent-posts__title">
																{e.name}
															</h2>
														</div>
													</a>
												</Link>
											</li>
										))}
								</ul>
							</div>
						</div>
					</div>
				</div>
			</section>
		</>
	);
}

export default NewsSingle;
